import React from "react";
import IgnorePage from "./du/IgnorePage";
import SpanPage from "./du/SpanPage";
import MuscleBagPage from "./du/MuscleBagPage";
import "./dungg.css";

function dungg() {
  return (
    <div className="test-page">
      <IgnorePage />
      <SpanPage />
      <MuscleBagPage />
    </div>
  );
}

export default dungg
